    [],nt"revision_timestamp": "2016-07-27T23:01:52.804052",nt"name": "fort-richardson-moose-tagging-project",nt"isopen":
    false,nt"url": null,nt"notes": "Of the big game animals that inhabit the
    Fort Richardson-Elmendorf AFB military reservation, moose (Alces a1ces gigas) are
    the predominant species and may be found anywhere on the area with the exception
    of the highest mountain ridges and peaks. Since knowledge of movements and population
    dispersal is of prime importance to the management of any mammal a moose tagging
    project was initiated on the reservation in an attempt to provide meaningful data.
    During 1975 to April 1977, 318 observations were recorded on 58 moose (17 males
    and 41 females). These data were used to study general home range patterns, seasonal
    movements, and habitat use patterns, and to determine if two distinct populations
    exist on the reservation. Prepared for the Alaska Interagency Moose Conference Meeting,
    Seward, Alaska, 4 May 1977.",nt"license_title": "License Not Specified",nt"extras":
